?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">История компании Ebel начинается с 1911 года, когда супруги Эжен Блюм и Алиса Леви решили создать свое собственное производство. Поводам для создания компании стало также то, что Эжен профессионально занимался часовым делом, а Алиса отлично разбиралась в дизайне и украшениях. На данный момент компания предлагает множество линеек часов, как мужских, так и женских. Все модели украшены золотом (желтое, белое или красное) и бриллиантами. Помимо этого, компания сосредотачивается на производстве особенных, лимитированных серий своих часов. Плюсом данной компании является еще и то, что в последнее время она увеличивает гарантийные обязательства на свою продукцию.</span></span></p>
 
